import * as React from 'react';
import { useState } from 'react';
import styles from './Calculator.module.css'

interface Props {
    streamingName: string;
}


export function Calculator(props: Props): React.ReactNode{

    const [count: number, setCount: void] = useState(0);

    return(
        <div className={styles.container}>
            {props.streamingName}
            <div className={styles.underline}>
                <input placeholder="30" className={styles.input} value={count} onChange={(event) => setCount(event.target.value)}/>
            </div>
        </div>
    );
}
